    false,nt"url": null,nt"notes": "In an attempt to address the concerns raised
    as a result of the marking of the 2004 brood at Warm Springs NFH, a study plan was
    developed to evaluate the use of an automated marking trailer at Warm Springs NFH.
    An automated marking trailer and a manual marking trailer were used to mark and
    coded-wire tag the brood year 2005 spring Chinook salmon at Warm Springs NFH. In
    this report, we compare tag retentions, mark quality, injury rates, and marking
    to release mortality between fish marked and tagged using an automated trailer and
    fish marked and tagged using a conventional manual trailer. A future report will
    look at release-to-adult survival rates.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
